import React from 'react';

function Header(){
	return(
		<div className='top-bar' style={style_topBar}>
			<h1 className='mont-font blue-c'>Profecient</h1>
			<input type='text' placeholder='Find classmates'/>

			<button className='not'><i class="fas fa-pencil-alt"></i></button>
			<button className='not'><i class="fas fa-user-friends"></i></button>
			<button className='not'><i class="fas fa-comments"></i></button>

			<button>Me</button>
			<button>Drop Down</button>
		</div>
	);
}

const style_topBar = {
	backgroundColor: '#171D1C', 
	color: 'white',
	paddingTop: 10,
	paddingLeft: 40,
	paddingRight: 40
}

export default Header;
